import {useConText} from "react"
import React, {Fragment} from 'react';

import classes from './Card.module.css'
import CartContext from '../..store/cart-context'

const Card = (props) => {
    return (
        <div className={classes.card}>
            {props.children}
        </div>
    )
}

export default Card
